import sys

def main():
    # Read input
    card = []
    for i in range(3):
        card.append([int(x) for x in sys.stdin.readline().split()])
    n = int(sys.stdin.readline())
    numbers = [int(sys.stdin.readline()) for i in range(n)]

    # Check rows and columns
    for i in range(3):
        if all(card[i][j] in numbers for j in range(3)):
            print('Yes')
            return
        if all(card[j][i] in numbers for j in range(3)):
            print('Yes')
            return

    # Check diagonals
    if all(card[i][i] in numbers for i in range(3)):
        print('Yes')
        return
    if all(card[i][2-i] in numbers for i in range(3)):
        print('Yes')
        return

    print('No')

if __name__ == '__main__':
    main()

