import sys

def main():
    # Read input
    lines = sys.stdin.readlines()
    bingo_card = []
    for i in range(3):
        bingo_card.append(list(map(int, lines[i].split())))
    N = int(lines[3])
    b_list = []
    for i in range(4, 4+N):
        b_list.append(int(lines[i]))

    # Check if there is a bingo
    for i in range(3):
        for j in range(3):
            if bingo_card[i][j] in b_list:
                bingo_card[i][j] = '*'

    # Check rows
    for i in range(3):
        if bingo_card[i][0] == '*' and bingo_card[i][1] == '*' and bingo_card[i][2] == '*':
            print('Yes')
            return

    # Check columns
    for j in range(3):
        if bingo_card[0][j] == '*' and bingo_card[1][j] == '*' and bingo_card[2][j] == '*':
            print('Yes')
            return

    # Check diagonals
    if bingo_card[0][0] == '*' and bingo_card[1][1] == '*' and bingo_card[2][2] == '*':
        print('Yes')
        return
    if bingo_card[0][2] == '*' and bingo_card[1][1] == '*' and bingo_card[2][0] == '*':
        print('Yes')
        return

    # If no bingo
    print('No')

if __name__ == '__main__':
    main()

